import React, { Component } from 'react'
import { Container } from 'reactstrap'

class Post extends Component {
    constructor (props) {
        super(props)
        this.state = {
            post: []
        }
    }
    // set state post before mount
    componentWillMount () {
        fetch('https://jsonplaceholder.typicode.com/posts')
        .then(res=>res.json())
        .then(data => this.setState({ post:data }), ()=>console.log(this.state.post))
    }
    render() {
       
    
        return (
            <div>
               <Container>
                    <h1>Post</h1>
                   
               </Container>
            </div>
        )
    }
}

export default Post;
